import React from "react";

const AdminDashboard = () => {
  return (
    <div className="mt-[75px]">
      <h1 className="text-3xl font-semibold px-4 py-4">
        Dashboard
      </h1>
      <div className="flex flex-col rounded-[4px] gap-4 border-d-"></div>
      <div className="flex flex-col rounded-[4px] gap-4 border-d-"></div>
      <div className="flex flex-col rounded-[4px] gap-4 border-d-"></div>
    </div>
  );
};

export default AdminDashboard;
